import {useEffect, useState, useRef} from 'react'
import './FInance.css'
import Api from './../../axios/Axios'
import Chart from 'chart.js/auto';



const Finance = ({goal}) => {

  const token = sessionStorage.getItem('token');

  const [finance,setFinance] = useState(undefined)
  const [total,setTotal] = useState(0)
  const [lessToGoal ,setLessToGoal] = useState(0)
  const [porcents ,setPorcents] = useState(0)
  const [graficStatus, setGraficStatus] = useState(false)

  useEffect(()=>{


    const customConfig = {
      headers: {
      'Content-Type': 'application/json',
      "Authorization" : `Bearer ${token}`
      }
  };


    async function loadToDoList(){
      await Api('/user/finance' ,customConfig).then((data)=>{
        setFinance(data.data.data)
      })
    }
    loadToDoList()
  },[])








  useEffect(()=>{
    if(goal !== undefined){
      setLessToGoal(goal-total)
      setGraficStatus(true)

    }
  },[goal])


  const ctx2 = document.getElementById("myChart2")
  console.log(ctx2)
  if( ctx2 !== null){




      console.log(lessToGoal)
      console.log(goal)
      console.log(graficStatus)




  var myChart2 = new Chart(ctx2, {
    type: 'doughnut',
    data: {
        labels: ['Falta', 'Investido'
    ],
        datasets: [{
            backgroundColor:[
                '#F5F4F4',
                '#9EC36E'],
            data: [(100) , 2000],
            borderRadius:[0,12],
            borderWidth:10,
            borderColor: ['#34efae00', '#9EC36E'],
            borderAlign:'center',
            spacing:-2,
        }]
    },
    options: {
        responsive: true,
        plugins: {
            labels: {
                display: false,
            },
            legend: {
                display: false,
            },
        },
        scales: {

            y: {
                display: false,
            },
            x: {
                display: false ,
            }           
        }
    },
});



}





  return (
    <div className='finance-box'>
      <div className="box-header">
                <h5>Financeiro</h5>
                <img src="./../../../img/icons/btnpurper.svg" alt="Adicionar" />
          </div>
          <div className='finance-container'>
            {finance !== undefined && total? 
            <>

                <div className="finance-left">
                  <div className="finance-left-top">
                    <p>Investido:</p>
                    <h2>{total}</h2>
                  </div>
                  <div className="finance-left-bottom">
                    <div>
                      <p>Faltam:</p>
                      <h4 className='finance-lessToFoal'>{lessToGoal}</h4>
                    </div>
                    <div>
                      <p>Planejamento:</p>
                      <h4 className='finance-goal'>{goal}</h4>
                    </div>
                  </div>
                </div>
                <div className="finance-right">
                  {graficStatus === true ?                 <canvas id="myChart2" width="100px" height="50px"></canvas>
 :''}
                <p className='finance-porcents'>{porcents}</p>

                </div>
            </>


            :

<>

        <div className="finance-left">
                  <div className="finance-left-top">
                    <p>Investido:</p>
                    <h2>{0}</h2>
                  </div>
                  <div className="finance-left-bottom">
                    <div>
                      <p>Faltam:</p>
                      <h4 className='finance-lessToFoal'>{goal}</h4>
                    </div>
                    <div>
                      <p>Planejamento:</p>
                      <h4 className='finance-goal'>{goal}</h4>
                    </div>
                  </div>
                </div>

                <div className="finance-right">
                <p className='finance-porcents'>0%</p>
                </div>

                </>                


            }

            </div>
    </div>
  )
}

export default Finance
